(16, 1, '2017-04-28 09:10:47', '2017-04-28 09:10:47', '<img class="alignnone wp-image-11" src="http://localhost/wordpress/wp-content/uploads/2017/04/3-300x225.jpg" alt="" width="340" height="255" />\r\n\r\n<strong>KYAKKYAWAN UWA</strong>\r\n\r\nA MUSULUNCI\r\n\r\nNA\r\n\r\nMUHAMMAD ABBA GANA\r\n\r\n1\r\n\r\n<strong>ABUBUWAN DA SUKE CIKI</strong>\r\n<ul>\r\n 	<li><strong>Godiya</strong></li>\r\n 	<li><strong>Gaisuwa</strong></li>\r\n 	<li><strong>Gabatarwa</strong></li>\r\n 	<li><strong>Shimfida</strong></li>\r\n 	<li><strong>Zabawa ya’ya uwa ta Gari</strong></li>\r\n 	<li><strong>Zamantakewa tsakanin uwa Tagari da maigidanta</strong></li>\r\n 	<li><strong>Zamantakewar uwa Tagari da iyayen Mijinta</strong></li>\r\n 	<li><strong>Zamantakewar uwa tagari da makota</strong></li>\r\n 	<li><strong>Tarbiyar uwa tagari ga yayanta</strong></li>\r\n 	<li><strong>Sakamakon uwa Tagari</strong></li>\r\n 	<li><strong>Mu’amalar uwa tagari day an uwan mijinta</strong></li>\r\n 	<li><strong>Mu’amalar uwa Tagari da abokan mijinta</strong></li>\r\n 	<li><strong>Mu’amalar uwa Tagari da surukanta</strong></li>\r\n 	<li><strong>Kammalawa</strong></li>\r\n</ul>\r\n<strong>2</strong>\r\n\r\n<strong>===========================================================</strong>\r\n\r\n<strong><u>GODIYA</u></strong>\r\n\r\nGodiya ta tabbata ga sarkin sarakuna sarkin da bai Haifa ba ba’a kuma haifeshi ba shugaban duk wata hallitta ya Allah ina rokonka ka Karen daga dukkan cutarwa, dan girman manzonka.\r\n\r\n<strong><u>GAISUWA</u></strong>\r\n\r\nDukkan gaisuwa ga yan uwa musulmai maza da mata Allah ya hada mu a Aljannah. Baran manta Da:\r\n<ul>\r\n 	<li>Albudullahi ahmad</li>\r\n 	<li>Rayyan A.A salisu</li>\r\n 	<li>Abubakar Garba</li>\r\n 	<li>Abubakar sadeeq (takai)</li>\r\n 	<li>Ahmad bello Hassan</li>\r\n 	<li>Gambo dan lami</li>\r\n 	<li>Ibrahim yusuf</li>\r\n 	<li>Habeebullah yareema usman</li>\r\n 	<li>Abubakar bello</li>\r\n 	<li>Zainab isa</li>\r\n 	<li>Sa’adatu giddado yahya</li>\r\n 	<li>Asma’u umar babayi</li>\r\n 	<li>Maman ameeda</li>\r\n</ul>\r\n<strong><u>GABATARWA</u></strong>\r\n\r\nIna gabatar da wannan littafi wanda ya kunshi takaitaccen bayani akan kyakkyawan uwa a musulunci. Domin a hakikanin gaskiya iyaye mata sun bambanta wajen tarbiyar ya’yansu Allay yasa mu dace, Ameen a karshe ina mika godiya da fatan alkairi ga malamina Abdullahi Mustafa a bisa shawarwarin daya bani har littafin ya kamala. 15/10/2016.\r\n\r\n&nbsp;\r\n\r\n<strong><u>SHIMFIDA</u></strong>\r\n\r\nAnnabi (S.A.W) yace: ana auren mace saboda abubuwa guda hudu, 1-kudinta 2-kyanta 3-danginta da kuma addininta, sai Annabi (S.A.W) yace na umurceku da ma’abociyar addini. Ya kamata mu kula cewa akwai banbanci tsakanin mace mai ilimi da kuma mai ibada. Mace mai ilimi ba lallai ta zama uwa ta gari ba, zamu gane hakan ne idan muka yi duba a wannan zamanin ta yadda za a a ga mace ma’abociyar ilimi amma tun daga shigarta za a sanyata cikin jahilai, to balalle kuma aje ga zamantakewa da kuma babban aikin wato tarbiyar yara” Allah yasa mu dace, amen.  Ahmad (R.A) ya ruwaito hadisi cewa anas dan malik (R.A) yace manzon Allah (S.A.W) ya kasance yana umurtanmu da yin aure, kuma yana hanamu ga barin aure, kuma yana cewa ka auri wacce take sonka, wacce take haihuwa, domin ni zan yi alfahari da yawanku a ranar alkiyama.\r\n\r\nShin wasu iyayen anya Annabi zaiyi alfahari da irin ya’yan da suke Haifa kuwa? Abinda yasa nai wannan tambaya shine yadda yanzu iyayen suke barin ya’yansu kamar ya’yan dabbobi saboda rashin samun ingantacciyar tarbiya, a yayin da uwa zata bar yayanta kamar yayan dabbobi babu kwaba, ba tsawatarwa hakan kuma bai isheta ba har sai tabi su da baki, ina matukar mamakin uwar da zata rika ambatar yayaanta da: shegu, dan/yar iska, assararre, jeka ka gani, da sauran wadanda ban Ambato bat un ana shayar da yaro ake ambata mishi wadannan kalmomin. Haba yan uwana me yasa ba zamuyi koyi da magabatanmu ba wajen tarbiyar ya’yanmu domin samun ya’ya masu albarka da kwazo wadda zasu taimaka wa sauran mutane dama duniya baki daya.\r\n\r\n<strong><u>ZABAWA UWA TAGARI</u></strong>\r\n\r\n&nbsp;\r\n\r\n<strong><u> </u></strong>\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'hy', '', 'publish', 'open', 'open', '', 'hy', '', '', '2017-04-28 18:11:13', '2017-04-28 18:11:13', '', 0, 'http://localhost/wordpress/?p=16', 0, 'post', '', 0),
